import { Flex, IconButton } from "@chakra-ui/react"
import {HamburgerIcon} from "@chakra-ui/icons"
import Toogle from "./toogle"

export default function NavBar(){
  return(
    <Flex bg="green" w="100%" h="2rem" >
      <IconButton
        colorScheme='teal'
        aria-label='Call Segun'
        size='sm'
        icon={<HamburgerIcon />}
      />
      <Toogle />
      
    </Flex>
  )
}
